import "./portfolio.scss"

export default function portfolio() {
    const list = [
        {
            id:"featured",
            title:"Featured",
        },
        {
            id:"web",
            title:"Web",
        },
        {
            id:"mobile",
            title:"Mobile",
        },
        {
            id:"logicel",
            title:"Logiciel",
        },
        {
            id:"jeux",
            title:"Jeux",
        },
    ];
    return (
        <div className="portfolio" id="portfolio">
            <h1>Portfolio</h1>
